// src/components/Skills.jsx
import React from 'react';
import './Skills.css';

const Skills = () => {
  return (
    <section id="skills" className="skills">
      <h2>Skills</h2>
      <ul>
        <li>Programming: C++, Python, Java, JavaScript, HTML, CSS, R</li>
        <li>Big Data: Apache Hadoop, Apache Spark, Apache Hive</li>
        <li>Database: MongoDB, SQL, MySQL, NoSQL</li>
        <li>Data Analysis: NumPy, Pandas, Matplotlib, Seaborn</li>
        <li>Cloud: Azure</li>
        <li>Version Control: Git, GitLab, Github</li>
        <li>Automation: Apache Airflow, Docker, CI/CD</li>
      </ul>
    </section>
  );
}

export default Skills;
